import React from "react";
import { Form, Card, ListGroup } from "react-bootstrap";

export default function UpsellListSection({ Name, Details }) {
  return (

      <Card.Body>
        <Card.Title>{Name}</Card.Title>
        <ListGroup variant="flush">
          {Details.map((i) => {
            return (
              <div>
                <ListGroup.Item key={i.id}>
                  <Form.Check
                    type="checkbox"
                    id="default-checkbox"
                    label="default checkbox"
                  />
                </ListGroup.Item>
              </div>
            );
          })}

        </ListGroup>
      </Card.Body>

  );
}
